script: |
  super -f tsv -I q411.sql | sort > q411.out

vector: true

inputs:
  - name: q411.sql
    data: |
      SELECT + cor0.col0 * - NULLIF ( - cor0.col0 * 31, cor0.col1 - - cor0.col1 ) FROM tab0 AS cor0 GROUP BY cor0.col1, cor0.col0, cor0.col2;
  - name: tab0

outputs:
  - name: q411.out
    data: |
      20956
      213559
      57319
